import React from 'react';
import ReactDom from 'react-dom';
import './index.css'
const firstbook={
  img: "https://m.media-amazon.com/images/I/A113y-6am4L._AC_UY327_FMwebp_QL65_.jpg",
  title:"PizzaExpress From Italy With Love:",
  info:'Eligible for delivery to Tunisia'

}
const secondbook={
  img: "https://media-cdn.tripadvisor.com/media/photo-s/1a/35/b3/c9/our-special.jpg",
  title:"PizzaExpress From New york With Love:",
  info:'Eligible for delivery to Tunisia'

}
const thirdbook={
  img: "https://media-cdn.tripadvisor.com/media/photo-s/20/6f/c4/4e/pizza.jpg",
  title:"Pizza&pasta From Italy With Love:",
  info:'Eligible for delivery to Tunisia'

}

const Booklist=()=>{
  return(
    <div className='love'>

      <Book img={firstbook.img} title={firstbook.title} info={firstbook.info}> 
      <p>come buy it bitch
        hateeeeeeeeeeeeeeeeeeeee
        america</p></Book>

      <Book  img={secondbook.img} title={secondbook.title} info={secondbook.info}/>
      <Book  img={thirdbook.img} title={thirdbook.title} info={thirdbook.info}/>


    </div>
  )
}
const Book=(props)=>{
  return (
    <section className='oyy'>

       <Title object={props.title} loool="47$"/>
       <img src={props.img} alt=""></img>
        <br></br>
         this is a Booklist
        {props.children}
        <Info />

    </section>
  )
}
const names=['lovee','moap'];
const NewName=names.map((name)=>{
  return <h1>name</h1>
});
const Title=({object,loool})=>{

  return <h1 style={{color:'#fff', fontSize:'2 rem',marginTop:'0.25rem'}}>{object}{loool}{Newname}</h1>
}


const Info=(props)=> <h3>{props.info}
 </h3>

